const results = [];

  for (const item of $input.all()) {
    const data = item.json;

    const passed = (data.actual_label === data.expected_label);

    results.push({
      json: {
        id: data.id,
        expected_label: data.expected_label,
        actual_label: data.actual_label,
        passed: passed
      }
    });
  }

  return results;

const items = $input.all();

  const total = items.length;
  const passed = items.filter(item => item.json.passed === true).length;
  const failed = total - passed;
  const accuracy = total > 0 ? ((passed / total) * 100).toFixed(1) : 0;

  const details = items.map(item => ({
    id: item.json.id,
    expected: item.json.expected_label,
    actual: item.json.actual_label,
    passed: item.json.passed
  }));

  return [{
    json: {
      total_tests: total,
      passed: passed,
      failed: failed,
      accuracy_percent: accuracy + '%',
      details: details
    }
  }];
